import React from "react";
import Item from "./Item";

const Listado = (props) =>{
    console.log(props.listado);
    return(
        <>
            <ul>
                {
                    props.listado.map((item, index)=>{
                        return <Item key={index} item={item} index={index} eliminar={props.eliminar} actualizar={props.actualizar}/>
                    })
                }
            </ul>
        </>
    );
}

export default Listado;
